### 思路
将数字转化为一个数组;之后将两个数组进行逐位相加.

### 代码

```js
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
    let len = num.length;
    let kSplitArr = String(k).split("").map(item => Number(item));
    let kSplitLen = kSplitArr.length;
    if(len < kSplitLen) {
        let temp = num;
        num = kSplitArr;
        kSplitArr = temp;
    }

    // 逐位相加
    let flag = 0;
    len = num.length - 1;
    while(kSplitArr.length || flag) {
        let kVal = kSplitArr.pop();
        let val;
        if(kVal >= 0) {
            val = num[len] + kVal + flag;
        } else {
            val = num[len] + flag;
        }
        flag = Math.floor(val / 10);
        num[len] = val % 10;
        if(flag && len - 1 < 0) {
           num.unshift(flag)
        }
        len--;
    }
    // console.log(num)
    return num;
};
```

**复杂度分析**
- 时间复杂度：O(N)，其中 N 为数组长度。
- 空间复杂度：O(1)

zhuxinyu-znb.body:
## 思路：
将k和num全都转化为num数组，倒叙排列后逐位相加，因为如果直接都转为数字相加的话，有可能会溢出。
逐位相加后如果超过9了说明需要进位，将进位符置1，如不满则为0，将保留各位后的数字push进结果数组。
依次相加后直到某个长度更短的数组全部遍历完后结束相加过程。
再将两数组剩余的部分进行遍历填充，这里要注意的是记得将之前的进位符进行处理，防止遗漏。
都遍历完之后再处理一遍进位符
最后将数组倒序回来就可以得到最终的结果
## 代码：
```javascript
/**
 * @param {number[]} num
 * @param {number} k
 * @return {number[]}
 */
var addToArrayForm = function(num, k) {
    let k_num = String(k).split('').map((num) => Number(num)).reverse()
    num = num.reverse()
    let temp = 0;
    const k_len = k_num.length;
    const num_len = num.length;
    let i = 0;
    let res_num = []
    while(i < k_len && i< num_len) {
        let res = k_num[i] + num[i] + temp
        if (res > 9) {
            temp = 1
            res = res - 10
        } else {
            temp = 0
        }
        res_num.push(res)
        i++
    }
    while(i < k_len) {
        let res = k_num[i] + temp
        if (res > 9) {
            temp = 1
            res = res - 10
        } else {
            temp = 0
        }
        res_num.push(res)
        i++
    }
    while(i < num_len) {
        let res = num[i] + temp
        if (res > 9) {
            temp = 1
            res = res - 10
        } else {
            temp = 0
        }
        res_num.push(res)
        i++
    }
    if (temp > 0) {
        res_num.push(temp)
    }
    return res_num.reverse()
};
```
## 复杂度：
时间复杂度为O(n)
空间复杂度为O(n)

